import { playEnterSound } from '../util/sounds'
import { Note } from '../logic/colllections/note'

export const DeleteButton = (props: {
  id: string
  hideNote: Function
  note: Note
}) => {
  return (
    <button
      onClick={() => {
        playEnterSound()
        fetch(`api/note`, {
          method: 'DELETE',
          body: JSON.stringify(props.note),
          // body: JSON.stringify(props.id),
        })
        props.hideNote()
      }}
    >
      Delete
    </button>
  )
}
